pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract TokenManager {
    address public admin;
    uint public percentageCut;
    mapping(address => uint) deposits;

    constructor(address adminAddress, uint percentage) {
        admin = adminAddress;
        percentageCut = percentage;
    }

    event DepositDone(
        address payer,
        uint depositId,
        uint amount,
        uint date
    );

    function balanceERC20(IERC20 token) external view returns (uint) {
        return token.balanceOf(address(this));
    }

    function depositBalance(address depositer) external view returns (uint) {
        return deposits[depositer];
    }

    function setAdminAndPercentageCut(address adminAddress, uint percentage) external {
        require(msg.sender == admin, "only admin change these"); 
        admin = adminAddress;
        percentageCut = percentage;
    }

    function deposit(IERC20 token, uint depositId, uint amount) external payable {
        require(amount > 0, "deposit 0 or more tokens");
        uint amountCut = (amount/100)*(percentageCut);
        uint amountDeposit = amount - amountCut;
        deposits[msg.sender] += amountDeposit;
        token.transferFrom(msg.sender, admin, amountCut);
        token.transferFrom(msg.sender, address(this), amountDeposit);
        emit DepositDone(msg.sender, depositId, amount, block.timestamp);
    }

    // can be used for withdrawal as well
    function transferFromContract(IERC20 token, address depositor, address to, uint amount) external {
        require(msg.sender == admin, "only admin can move funds"); 
        uint erc20balance = deposits[depositor];
        require(amount <= erc20balance, "withdraw amount more than balance");
        token.transfer(to, amount);
    }
}
